import React, {Component} from 'react';
import stylesheet from './styles.js';

export default class Button extends React.Component {
	constructor() {
		super();
		this.state = { blue: false}
	}

	sayHello() {
		this.setState({blue: !this.state.blue});
	}
	render() {
		let btnColor = this.state.blue ? "blueBtnC" : "defaultBtn";
		return(
			<button className={btnColor} onClick={this.sayHello} style={stylesheet.btnmain}>Get Started</button>
		);
	}
}
